import React, { useState } from 'react';
import './CSS/CSS_FILE.css';

function About() {
    const [currentStep, setCurrentStep] = useState('content4');
    const [username, setUsername] = useState(''); // State for username
    const [email, setEmail] = useState(''); // State for email
    const [query, setQuery] = useState(''); // State for query
    const [nameError, setNameError] = useState(false); // State for name error
    const [emailError, setEmailError] = useState(false); // State for email error

    const backToName = () => {
        setCurrentStep('content4');
    };

    const enterEmail = () => {
        if (username.trim() !== '') {
            setCurrentStep('content5');
        } else {
            setNameError(true); // Set name error to true to display red border
        }
    };

    const submit = () => {
        if (email.trim() !== '') {
            setCurrentStep('content6');
        } else {
            setEmailError(true); // Set email error to true to display red border
        }
    };

    const handleNameChange = (e) => {
        setUsername(e.target.value);
        if (e.target.value.trim() !== '') {
            setNameError(false); // Clear name error when name is entered
        }
    };

    const handleEmailChange = (e) => {
        setEmail(e.target.value);
        if (e.target.value.trim() !== '') {
            setEmailError(false); // Clear email error when email is entered
        }
    };

    return (
        <div>
            <div className="section" id="contact">
                {currentStep === 'content4' && (
                    <div className="content4" id="content4">
                        <div className="contacthead">
                            <h1>
                                <center>Hire Me</center>
                            </h1>
                        </div>
                        <div className="contactsub">
                            <center>Complete the form to get in touch with me</center>
                        </div>
                        <div className={`input ${nameError ? 'error' : ''}`}>
                            <div><i className="bi bi-person"></i></div>
                            <input type="text" id="username" name="username" placeholder="Enter Your Name" value={username} onChange={handleNameChange} />
                        </div>
                        <button onClick={enterEmail} className="getstarted" disabled={!username.trim()}>
                            Get Started
                        </button>
                    </div>
                )}

                {currentStep === 'content5' && (
                    <div className="content5" id="content5">
                        <div className="contactsub">
                            <center>Your Email*</center>
                        </div>
                        <div className={`input ${emailError ? 'error' : ''}`}>
                            <div><i className="bi bi-envelope"></i></div>
                            <input type="text" id="email" name="email" placeholder="Enter Your Email" value={email} onChange={handleEmailChange} />
                        </div>
                        <div className="textarea">
                            <textarea type="text" id="query" name="query" placeholder="Tell me about your needs" value={query} onChange={(e) => setQuery(e.target.value)}></textarea>
                        </div>
                        <div className="twobutt">
                            <button onClick={backToName} className="backtoname"><i className="bi bi-arrow-left-short"></i></button>
                            <button onClick={submit} className="submit" disabled={!email.trim()}>
                                Submit
                            </button>
                        </div>
                    </div>
                )}

                {currentStep === 'content6' && (
                    <div className="content6" id="content6">
                        <div className="contacthead">
                            <h1>
                                <center>Thank You!</center>
                            </h1>
                        </div>
                        <div className="contactsub">
                            <center>Your message is on its way and I will try to respond as soon as possible.</center>
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
}

export default About;
